`,s.jsx(e.p,{children:"The Dark Web is often known for the illicit Activities that are carried out over it. This has portrayed the Dark Web as a dangerous place on the Internet. However, the Dark Web is used for more than that. Law enforcement agencies and cybersecurity professionals use Tor for undercover operations, intelligence gathering, and security research to combat cybercrime, terrorism, and fraud. Researchers, companies, and individuals dealing with sensitive topics (such as cybersecurity, medical research, or financial transactions) use Tor to protect trade secrets, proprietary data, and confidential communications from cyber threats and corporate espionage. Human rights activists and political dissidents use Tor to evade surveillance and protect themselves from oppressive governments that seek to suppress dissent. This fosters democracy and civil liberties worldwide."})]})}function E4(n={}){const{wrapper:e}=n.components||{};return e?s.jsx(e,{...n,children:s.jsx(Ty,{...n})}):Ty(n)}function Py(n){const e={a:"a",code:"code",em:"em",h1:"h1",h2:"h2",h3:"h3",h4:"h4",h5:"h5",img:"img",li:"li",ol:"ol",p:"p",strong:"strong",ul:"ul",...n.components};return s.jsxs(s.Fragment,{children:[s.jsx(e.h1,{children:"Designing The Conveyor CI Pipeline Engine"}),`
`,s.jsxs(e.p,{children:["In CI/CD Systems, there is a concept of pipelines. Pipelines define the steps of how code changes throughout the entire CI/CD process. Multiple systems like Github Actions, GitLab CI/CD, Jenkins etc all have this functionality of pipelines natively embedded within them, something that ",s.jsx(e.a,{href:"https://conveyor.open.ug/",children:"Conveyor CI"})," currently lacks. You could engineer a walkaround to implement your own pipeline-like functionality in Conveyor but natively, this functionality does not exist and this is a serious downside existing within Conveyor."]}),`
`,s.jsxs(e.p,{children:["This got me thinking, how could I implement it. As you might guess from the name, Conveyor CI was inspired by how a ",s.jsx(e.a,{href:"https://en.wikipedia.org/wiki/Conveyor_system",children:"conveyor system"})," in an industry works. Take an example of a car manufacturing factory, the skeleton of the car moves along the conveyor system and at each step there is a dedicated robot in charge of attaching a certain component to the car to carry out a certain function. By the time the skeleton reached the final stage, its a complete car. From the start I wanted to adopt this kind of concept as the core paradigm of Conveyor CI whereby a resource(e.g. source code) moves on a belt and at the end of the belt, all necessary actions are carried out."]}),`
`,s.jsx(e.p,{children:"With this in mind, I split the Conveyor CI into components in order to easily understand it adopting from components of a conveyor system ie. Package, conveyor belt, and Peripheral equipment. In that I came up with the following:"}),`
`,s.jsxs(e.ul,{children:[`
`,s.jsxs(e.li,{children:[s.jsx(e.strong,{children:"Resource"}),": The resource is an internal object in Conveyor that represents what is being acted upon throughout the CI/CD process. Think of it as the Package on a conveyor system. It can represent anything from source code, and application, a program etc."]}),`
`,s.jsxs(e.li,{children:[s.jsx(e.strong,{children:"Drivers"}),": Drivers are software components that carry out certain actions depending on the state defined in the Resource. Think of them as the peripheral devices that act on a package as it moves along a conveyor system. In this case the Packages are the Resources."]}),`
`]}),`
`,s.jsx(e.p,{children:"Notice I have not mentioned a component that corresponds to the conveyor belt. That is because currently there was none, and to create one was where pipelines come in."}),`
`,s.jsx(e.p,{children:"So currently in Conveyor CI we have Resources and Drivers. They are generally mature enough as individual components and although you could create an entire CI/CD tool with these only, there are still some issues. Mainly is that there is no order of execution of drivers upon a Resource. This means that once a Resource event occurs, all drivers execute their corresponding actions whenever they receive the event and they do this in no orderly fashion. This means it is not possible to predict what action will occur at what point in the CI/CD process and you also can’t create dependency actions that depend on others being pre-executed. An example is if you have a workflow whereby you compile your source code then upload the output program to a distribution server, You might have two drivers, one for compiling and another for uploading. In the current implementation, these drivers will execute at once, yet the uploading driver should depend on the constraint that the compiling driver is done executing."}),`
`,s.jsx(e.p,{children:"To fix this we have to come up with a way to define a workflow that drivers must follow when carrying out their executions, something that defines the steps and order that these drivers will follow throughout execution. Something to act as the conveyor system. This is where Pipelines Come in. They will define the order of execution followed by drivers. The pipeline can be an object containing the configuration defining the order followed by drivers."}),`
`,s.jsx(e.p,{children:"Pipelines also introduce more possibilities like shared context among driver executions, meaning, a pipeline can define some metadata that is shared and used across all the drivers that are executing upon a resource in that pipeline."}),`
`,s.jsx(e.h2,{children:"Implementing Pipelines"}),`
`,s.jsx(e.p,{children:"Now that I had come up with a high level design of what pipelines are expected to work, I had to move on to designing an implementation that would easily fit in into the existing Conveyor CI implementation. Inorder to create a implementation that is good, i set a few constraints that i had to follow:"}),`
`,s.jsxs(e.ol,{children:[`
`,s.jsx(e.li,{children:"Pipelines should not introduce breaking changes that might interfere with the Developer experience and development paradigm for developers developing drivers. It should be more of an incremental change, building upon the already existing development paradigm without breaking already existing codebases."}),`
`,s.jsx(e.li,{children:"Minimize the risk of over engineering the system while trying to follow constraint one. This is because usually one trade off of maintaining a good developer experience is that you might end up over engineering the system."}),`
`]}),`
`,s.jsx(e.p,{children:"With these design constraints in mind, I embarked on designing the Pipeline engine. First I started with the usage workflow from the user viewpoint i.e. the process that will be followed by a developer when creating a pipeline and using it."}),`
`,s.jsx(e.h3,{children:"Use case Workflows"}),`
`,s.jsx(e.p,{children:"Considering that developer experience is one of the most important concepts for the success of a tool, I had to come up with a really easy to understand workflow and also not break the already existing usage workflows in Conveyor CI. I came up with this."}),`
`,s.jsxs(e.ul,{children:[`
`,s.jsx(e.li,{children:"First a pipeline is designed by the developer choosing their appropriate drivers and resources and arranging them in a desired order."}),`
`,s.jsx(e.li,{children:"The pipeline is then sent to the Conveyor CI API Server to be registered and saved."}),`
`,s.jsx(e.li,{children:"Once its saved then a Resource that is using that pipeline is created and sent to the API server"}),`
`,s.jsx(e.li,{children:"Then the Pipeline Engine appropriately routes the resource to the drivers."}),`
`,s.jsx(e.li,{children:"Driver do there work"}),`
`]}),`
`,s.jsx(e.h3,{children:"How the Engine Works"}),`
`,s.jsx(e.p,{children:"With this in mind, I came up with a system design that can accomplish these functions but also act as an incrementation on the existing Conveyor base."}),`
`,s.jsxs(e.p,{children:["First a new state object called a ",s.jsx(e.em,{children:"Pipeline"})," was introduced into the system. This object would store and represent information about a pipeline throughout the stages of execution. It would store the order of execution followed by drivers and additional context information/metadata that is required by the driver in said pipeline."]}),`
`,s.jsxs(e.p,{children:["I also had to introduce a ",s.jsx(e.em,{children:"Driver Result"})," event object. This object, acting as an event, was to be used by drivers to communicate the result of the ",s.jsx(e.code,{children:"Reconcile"})," function(The function that is run when a driver receives a resource to act upon). This would be used to inform the Pipeline Engine if a desired driver operation was successful or not."]}),`
`,s.jsxs(e.p,{children:["In order to maintain realtime seamless execution, a new execution process running concurrently with the API Server had to be introduced to Conveyor CI's core runtime program. This would be in charge of listening for new resources attached to pipelines, routing those resources to drivers in a pre-defined order as defined in the ",s.jsx(e.em,{children:"Pipeline"})," objects, and watching for pipeline realworld state changes and reconciling it to the state stored in the Database. This process is what I named the ",s.jsx(e.strong,{children:"Pipeline Engine"})]}),`
`,s.jsx(e.h4,{children:"Execution Workflow"}),`
`,s.jsx(e.p,{children:"Having introduced the required components, I came up with this workflow."}),`
`,s.jsxs(e.ul,{children:[`
`,s.jsx(e.li,{children:"The user sends a POST request to the Conveyor API server to register their Pipeline, this is then saved to the ETCD Database."}),`
`,s.jsx(e.li,{children:"Then the user creates a pipeline Resource(a resource that depends on that pipeline), also via the API Server."}),`
`,s.jsx(e.li,{children:"When the API server receives and saves this Resource to the DB, it sends an Event to the Pipeline Engine."}),`
`,s.jsx(e.li,{children:"The Pipeline Engine receives the Event and using the event metadata it collects the Pipeline information from the DB and depending on the driver execution order defined by the pipeline it begins to send events to the drivers."}),`
`,s.jsxs(e.li,{children:["Once the Driver has finished to carry out its functions, it returns a ",s.jsx(e.em,{children:"Driver Result"})," and the Driver Manager sends that result as an event back to the Pipeline Engine."]}),`
`,s.jsx(e.li,{children:"When the Result event is received, the Pipeline engine can then move on to sending the event to the next driver. If no result event has been received yet from the Driver, the Engine wont move on to the next Driver."}),`
`,s.jsx(e.li,{children:"Lastly, if the result event on one driver indicates that the Driver execution failed or an error occurred. The pipeline engine won't send events to the remaining drivers and will rather register the pipeline as stopped or done with a status of failed. Else it will finish execution of all drivers and still register the pipeline as done/complete."}),`
`]}),`
`,s.jsx(e.h5,{children:"A Simple Diagram representing this process"}),`
`,s.jsx(e.p,{children:s.jsx(e.img,{src:"/img/pipeline-engine.png",alt:"Pipeline Ecexution flow"})}),`
`,s.jsx(e.h4,{children:"Technical Details"}),`
`,s.jsx(e.p,{children:"I have managed to describe the high level working of how the Pipeline engine would work. But beyond that, integrating such functionality into the Conveyor Stack requires clarification on how to implement the different components technically."}),`
`,s.jsxs(e.p,{children:["Starting off with the Pipeline engine itself, we said it's a process running concurrently with the API Server in the same program. Considering that the Conveyor CI core software program is written in the ",s.jsx(e.a,{href:"https://go.dev/",children:"Go programming language"})," and Go as a language has inbuilt concurrency via the ",s.jsx(e.a,{href:"https://www.geeksforgeeks.org/go-language/goroutines-concurrency-in-golang/",children:"Go routines"}),", this means that the Pipeline Engine would better be a go routine running alongside the API server on the same process. One upside of this mechanism of embedding the Pipeline engine into the same process with the API Server is that we will require little updates to the metrics and monitoring codebase in order to add metrics for monitoring the Pipeline Engine."]}),`
`,s.jsxs(e.p,{children:["Inorder to achieve the realtime nature of execution among these separate execution runtimes, we utilize events via ",s.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream",children:"NATS Jetstream"}),", the message broker that is already being used by Conveyor. This means that the Pipeline Engine performs both the roles of an Event publisher and subscriber. When new Pipeline resources are created, an event is sent to the Pipeline engine via JetStream. In this scenario, the Pipeline Engine is running as a ",s.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream/consumers",children:"Jetstream Consumer"}),", listening for events via the ",s.jsx(e.code,{children:"pipeline"})," ",s.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream/streams",children:"stream"}),". Upon receiving an event, it will collect the pipeline data from ETCD and collect all the driver names. Using the driver names it will now become an event publisher and publish to the ",s.jsx(e.code,{children:"messages"})," stream(the default stream in which drivers listen for events) and use the subjects with the following semantics ",s.jsx(e.code,{children:"{DRIVER_NAME}.resources.{RESOURCE_NAME}"})," with the placeholders ",s.jsx(e.code,{children:"{DRIVER_NAME}"})," and ",s.jsx(e.code,{children:"{RESOURCE_NAME}"})," referring to the name of the driver to publish to and the name of the resource being published respectively. All we have to do now is update the driver managers of the drivers, to include the new subject in the filtered subjects field of there Jetstream consumers. THis will require updating all the SDKs though. With this, we have a complete working Pipeline engine."]}),`
`,s.jsxs(e.p,{children:["Finally to keep track of Driver executions that belong to one pipeline, we utilize an already existing concept in Conveyor CI which is the ",s.jsx(e.code,{children:"Run ID"}),". This is a ",s.jsx(e.em,{children:"UUID"})," string that identifies individual driver runs/executions upon a resource. In a pipeline, we maintain the same run ID throughout executions in a single pipeline execution."]}),`
`,s.jsx(e.h2,{children:"Conclusion"}),`
`,s.jsx(e.p,{children:"The whole point of Pipelines was to introduce ordered execution of drivers on a resource but this feature can act as a fundamental building block for more robust and important functionality to be integrated into Conveyor CI. With this I have to acknowledge that Conveyor CI is still a really immature project, it really still has a long way to go and still lacks important features e.g. resource versioning etc. But one step at a time. Just like Rome wasn't built in a day, You can build a Cloud native software framework in a short period of time. As I keep learning more about software, from my Software Engineering Degree I am pursuing, the Internet and other Cloud Native projects and Engineers, I will keep applying those innovative ideas to the Conveyor CI project. Lets just wait and see what the future holds."})]})}function k4(n={}){const{wrapper:e}=n.components||{};return e?s.jsx(e,{...n,children:s.jsx(Py,{...n})}):Py(n)}function Ly(n){const e={a:"a",blockquote:"blockquote",code:"code",figure:"figure",h1:"h1",h2:"h2",h3:"h3",img:"img",li:"li",ol:"ol",p:"p",pre:"pre",span:"span",strong:"strong",...n.components};return s.jsxs(s.Fragment,{children:[s.jsx(e.h1,{children:"Designing the Conveyor CI Scheduling Mechanism"}),`
`,s.jsx(e.p,{children:s.jsx(e.img,{src:"https://fulcrum.rocks/blog/wp-content/uploads/2022/04/ci-cd-pipeline-7.png",alt:""})}),`
`,s.jsx(e.p,{children:"A brief introduction on Conveyor CI. Its is a Software framework fdesigned to simplify the development of scalable and reliable CI/CD platforms by eliminating common pain points that a team ight to run into inorder to build a Scalable, reliable CI/CD Platform. It provides a simplified  streamlined, developer-friendly development paradigm for building robust custon CI/CD Tools."}),`
`,s.jsx(e.p,{children:"Recently a team that uses Conveyor CI as a dependency had an inquiry on how a CI Driver in conveyor can handle multiple instances of running CI processes without overloading the host node. This is a really important consideration I had not thought of, and for a system that runs multiple tasks in concurrency, being conscious of system resources is a really important consideration."}),`
`,s.jsxs(e.p,{children:["This got me thinking, how best can one approach such an issue. I thought of multiple solutions to this, I had considered introducing a consensus algorithm like raft, however this wasn't really an effective solution. Looking into how the Kubernetes Kube Scheduler efficiently allocates Pods to run on different nodes taking into considerations or the resource constraints of both the Pod to be allocated and the nodes its to be allocated to gave me an inspiration of having to design a custom ",s.jsx(e.a,{href:"https://en.wikipedia.org/wiki/Scheduling_(computing)",children:"scheduling algorithm"})," that had to to take into consideration of the multiple, use case scenarios of CI/CD tools and what constraints they operate under."]}),`
`,s.jsx(e.p,{children:"I had to first come up with the high level requirements and problem statements for the CI Drivers in order to tackle this issue."}),`
`,s.jsxs(e.blockquote,{children:[`
`,s.jsxs(e.p,{children:[s.jsx(e.strong,{children:"The Problem"}),": In large production grade CI/CD Pipelines, multiple requests can initiated at the same time and due to the underlying concurrent and instant execution of CI tasks by Conveyor CI Drivers, this introduces an issue of possible node crashed or driver process termination by the Operating system due to the host node running out of system resources. Also currently, drivers don't support horizontal scalability, something that is really important for CI/CD tools that are expected to run multiple workloads at a certain point in time considering vertical scalability tends to be finite and also costs tend to increase exponentially the more you scale vertically."]}),`
`]}),`
`,s.jsx(e.p,{children:"From that problem statement I managed to identify two high level requirements."}),`
`,s.jsxs(e.ol,{children:[`
`,s.jsx(e.li,{children:"Drivers should support horizontal scaling"}),`
`,s.jsx(e.li,{children:"The Driver runtime should take into consideration available node resources before executed a task"}),`
`]}),`
`,s.jsxs(e.p,{children:["After a long night of insightful research, I came up with a bunch of solutions for this, these would assist me in designing the scheduling algorithm. I would call the ",s.jsx(e.strong,{children:"functional or technical requirements"})," if that's the right term to use."]}),`
`,s.jsx(e.p,{children:"The algorithm was to take inspiration and be a combination of multiple OS scheduling algorithms, with the help of a consensus algorithm to handle and support the distributed properties of the Driver instances."}),`
`,s.jsxs(e.p,{children:["To solve the issue of the possibility of overloading the server with tasks that require system resources than available, First i had to remove the instant execution of tasks and introduce a task queue, this would enable me to be able to incorporate a ",s.jsx(e.a,{href:"https://en.wikipedia.org/wiki/FIFO_(computing_and_electronics)",children:"FIFO-like"})," architecture as the base algorithm for scheduling tasks in a normal flow. Taking into consideration that in certain organisations, CI/CD tools are designed with the concept of having some tasks prioritized due to multiple factors, say if they would like to prioritize tasks from paying users. I also decided to incorporate a ",s.jsx(e.a,{href:"https://en.wikipedia.org/wiki/Dynamic_priority_scheduling",children:"Priority Scheduling Algorithm"})," as the second level algorithm. Lastly, I had to introduce a ",s.jsx(e.a,{href:"https://www.sciencedirect.com/science/article/pii/S1474667017377388",children:"constraint based scheduling"})," algorithm as the last determining algorithm, these constraints can be the available system resources etc. To support such a complex algorithm, I had to introduce ",s.jsx(e.a,{href:"https://en.wikipedia.org/wiki/Heuristic",children:"heuristics"})," that are computed by the Driver from a resource specification or defined directly in the resource specification. These heuristics can be task priority, available node resources etc."]}),`
`,s.jsx(e.p,{children:"On the issue of horizontal scalability, I decided to incorprate NATS Jetsream Consumers. This would enable distributed processing of Driver tasks laveraging the already existing powerfull features that NATS Jetstream offers out of the box."}),`
`,s.jsx(e.h2,{children:"How the Mechanism works"}),`
`,s.jsx(e.p,{children:"Alright, let's get into how it works. At the core, the tasks are organized in a priority queue, where tasks with a high priority are executed first and in instances where the priority number is equal, they are executed based on a FIFO order based on a timestamp."}),`
`,s.jsx(e.h3,{children:"Preventing resource contention"}),`
`,s.jsxs(e.p,{children:["Within the tasks Resource specification, I introduced an optional field called ",s.jsx(e.code,{children:"resourceUsage"})," that defines the expected resource usage for the task during execution. This acts as heuristic that helps the driver runtime decide whether a certain driver instance is allowed to run the task. It compares the available host node system resources and evaluates whether running that task will not cause resource contention or Out of Memory Errors. This constraint based scheduling considers any node as long as adding the task won't exit 100 percent usage of the resources, that's to say, even if a node is using up to 90% of its resources and adding the task will push it to 99% it will still schedule it on that node. it also tends to prioritize driver instances running on nodes with lower resource usage than the others, say if node A is using 60% and node B is using 55%, it's more likely to consider node B than A. But this will not always be the case, sometimes other factors might cause us to consider node A. Such a mechanism will ensure that the possibility of node failures due to resource contention is really low."]}),`
`,s.jsx(e.p,{children:"Here is some Pseudo code example to demonstrate the algorithm structure"}),`
