`,s.jsx(e.h3,{children:"Horizontal Scaling"}),`
`,s.jsx(e.p,{children:"When it comes to horizontal scaling, I decided to re-engineer the Drivers to run as a distributed system in cases where there are multiple driver instances running. This distributed system is powered by NATS JetStream Consumers"}),`
`,s.jsxs(e.p,{children:["At the core each Conveyor CI Driver operates as a ",s.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream/consumers",children:"JetStream Consumer"}),". They listen to a ",s.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream/streams",children:"stream"})," which filters out required messages and pushes them to the driver. The driver then carries out the required tasks depending on the payload recieved from the stream."]}),`
`,s.jsx(e.p,{children:"The Drivers are configured to use Explicit acknowledgement with the value set to 1 so that each task it handles one by one and this would prevent a possibility of one driver handling multiple tasks at once possibly causing resource contention. Acknowledgement occurs once the message is recieved by the driver. We also set the Delivery policy to All, so that no task is skipped and all tasks are handled. Another feature that Jet"}),`
`,s.jsx(e.p,{children:"By utilising JetStream, it enables driver to be able to infinitly scale horizontally and become more failt torolent by utilizing various inbuilt NATS features."}),`
`,s.jsx(e.p,{children:s.jsx(e.img,{src:"/img/drivers1.png",alt:""})}),`
`,s.jsx(e.h2,{children:"Conclusion"}),`
`,s.jsx(e.p,{children:"Designing a robust scheduling algorithm for Conveyor CI Drivers was a necessary and will definetely improve the functionality and reliability of the Drivers when the scheduling mechanism is added to the Conveyor CI codebase. By combining FIFO, priority-based, and constraint-aware scheduling with a distributed model powered by JetStream, I’ve managed to create a system that not only prevents resource overloads but also opens the door for true horizontal scaling and more features like fault tolorence. This isn’t just a theoretical improvement—it directly addresses real-world pain points for teams running concurrent workloads on shared infrastructure. There’s still room to refine and optimize, but this foundation sets the stage for building CI/CD systems that are both resilient and adaptive under pressure. This might be the greatest improvement to Conveyor CI yet."})]})}function D4(n={}){const{wrapper:e}=n.components||{};return e?s.jsx(e,{...n,children:s.jsx(Ly,{...n})}):Ly(n)}function Iy(n){const e={a:"a",blockquote:"blockquote",code:"code",figure:"figure",h1:"h1",h2:"h2",h3:"h3",h4:"h4",img:"img",li:"li",ol:"ol",p:"p",pre:"pre",span:"span",strong:"strong",ul:"ul",...n.components};return s.jsxs(s.Fragment,{children:[s.jsx(e.h1,{children:"A Guide to contributing to the Conveyor CI Driver Runtime"}),`
`,s.jsx(e.p,{children:"A detailed guide to contributing to the Conveyor CI Driver runtime."}),`
`,s.jsx(e.h2,{children:"Introduction"}),`
`,s.jsx(e.p,{children:"A brief introduction on the Conveyor CI Driver runtime."}),`
`,s.jsxs(e.p,{children:["The Conveyor CI Driver runtime is a collection of SDKs(Software Development Kits) used by developers to build Conveyor CI ",s.jsx(e.a,{href:"https://conveyor.open.ug/docs/concepts/drivers",children:"Drivers"}),". These SDKs are libraries that contain Utility functions that expose different Conveyor CI functionality. In this Guide we shall explore how one can contribute to the Conveyor CI Driver Runtime. This Guide is written to be language agnostic, meaning it can guide you to build or contribute to a driver runtime of your language of choice."]}),`
`,s.jsx(e.h2,{children:"How the Driver Runtime Works"}),`
`,s.jsx(e.p,{children:"Lets explore what the Runtime is"}),`
`,s.jsx(e.h3,{children:"What is the Driver Runtime"}),`
`,s.jsx(e.p,{children:"You can think of the Driver runtime as the wrapper of Driver applications and is the environment in which Drivers execute. You can define it as the software layer that provides necessary services, infrastructure, and behavior for executing the driver. Think of how language runtime work like the JVM, Go Runtime, V8, CPython etc. If you where to write a program in those languages, run in an environment that contains your code and the language runtime."}),`
`,s.jsx(e.p,{children:"So even when building a Conveyor CI Driver, the final program is a combination of the Driver runtime and your custom Driver code."}),`
`,s.jsx(e.p,{children:s.jsx(e.img,{src:"https://conveyor.open.ug/assets/images/Driver-Runtime-276f53e45dbccb2ee74a6112e2561b56.png",alt:"Conveyor CI"})}),`
`,s.jsx(e.h3,{children:"What Features does it Provide"}),`
`,s.jsx(e.p,{children:"As mentioned earlier, the driver runtime provides necessary services and utilities for building CI Drivers. Some of these features are not just exclusive to the runtime but rather and extension of the base features provided by the Conveyor CI Ecosystem. These features include:"}),`
`,s.jsxs(e.ul,{children:[`
`,s.jsx(e.li,{children:"A mealtime Event System: The driver runtime is designed to ensure drivers receive and publish events within the Conveyor System to ensure quick and instant execution of tasks."}),`
`,s.jsxs(e.li,{children:["Log Management: The Driver runtime provided a ",s.jsx(e.a,{href:"https://conveyor.open.ug/docs/concepts/drivers#driver-logger",children:"Driver Logger"}),", that provides drivers with functionality to export and save necessary logs in real-time. These can then be fetched or streamed in real-time or for future use."]}),`
`,s.jsx(e.li,{children:"Horizontal Scaling: The Driver runtime provides out of the box Horizontal Scaling to Drivers, meaning once you build a driver. It comes with the ability to horizontally scale into a distributed system efficiently without you writing any custom code. This feature can be really important in Cloud Native environments."}),`
`,s.jsx(e.li,{children:"Conveyor CI API Server Interaction: No driver runtime package is complete without utility functions to interact with the Conveyor API Server to for example create and manipulate Resources."}),`
`,s.jsx(e.li,{children:"Observability out of the Box: The Driver runtime is designed to provide a comprehensive observability platform that follows all the three pillars that include Metrics, Tracing and Logging."}),`
`]}),`
`,s.jsx(e.p,{children:"And many more..."}),`
