`,s.jsxs(e.p,{children:["The Driver manager, the component that encapsulates the Driver and provides utilities that are used by the Driver. By design, it is usually a ",s.jsx(e.code,{children:"Class"})," or a Class-like data type that has a ",s.jsx(e.code,{children:"run()"})," method that is called to start the program. Its is responsible for the following functionality."]}),`
`,s.jsxs(e.p,{children:["Listening for events from Conveyor CI sent via NATS Jetstream: This is accomplished using JetStream ",s.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream/streams",children:"Streams"})," and ",s.jsx(e.a,{href:"https://docs.nats.io/nats-concepts/jetstream/consumers",children:"Consumers"}),". The Driver manager contains a Consumer that listens for events from the ",s.jsx(e.code,{children:"messages"})," stream and filters out subjects depending on the resources that the Driver defines to listen to."]}),`
`,s.jsxs(e.p,{children:["Provides the Driver Logger to the Driver. The driver logger is a component that collects logs from the driver and send them to Grafana Loki for Storage. After storing them it also streams them via a NATS connection on the subject with the following semantics ",s.jsx(e.code,{children:"driver:{DRIVER_NAME}:logs:{RUN_ID}"})," with the place holders ",s.jsx(e.code,{children:"DRIVER_NAME"})," and ",s.jsx(e.code,{children:"RUN_ID"})," referring to the name of the driver and the current run id respectively."]}),`
