`,s.jsx(e.p,{children:"At a high level point of view the EDA is quite straight forward. Events representing occurrences or changes in the system drive the flow are generated by various sources (Publishers), published to an event bus or message broker, and consumed by interested components (Consumers) asynchronously. This approach promotes flexibility, scalability, and resilience."}),`
`,s.jsx(e.p,{children:"An event is any change in state of the system and can be anything ranging from customer requests, inventory updates, sensor readings, and so on."}),`
`,s.jsxs(e.p,{children:["The event-driven architecture enables different components of a system to run independently of each other by introducing a middleman known as an ",s.jsx(e.strong,{children:"Event broker"})," that routes events to different intended destination components. This means that applications and devices do not need to know where they are sending information or where the information they are consuming comes from. Rather they focus on carrying out there intended functionality."]}),`
