`,s.jsxs(e.p,{children:["In an event-driven system, ",s.jsx(e.strong,{children:"topics"})," are labels used to organize and route events. When an event is published, it is associated with a specific topic, and consumers subscribe to topics to receive events relevant to them. This approach allows producers to send events without needing to know which consumers will process them, while consumers only handle events tied to their subscribed topics. For example, an event with the topic ",s.jsx(e.code,{children:"orderCreated"})," could be published by a producer, and any consumers subscribed to ",s.jsx(e.code,{children:"orderCreated"})," would receive and process the event."]}),`
